type appType = {
    store: StoreType
    //dispatch: (action: ActionType) => void
}

const App: React.FC<appType> = (props) => {
    return (

            <div className={s.appWrapper}>
                <HeaderContainer/>
                <Navbar/>
                <div className={s.appWrapperContent}>
