                        state={props.store.getState()}
                        dispatch={props.store.dispatch}
                    />}/>
                    <Route path="/profile/:userId?" render={() => <ProfileConnect/>}/>
                    <Route path="/users" render={() =><UsersContainer/>}/>
                    {/* <Route path="/news" />
                <Route path="/music" />
                <Route path="/settings" />*/}
                    {/*<Profile/>*/}
                    {/*<Dialogs/>*/}

                </div>
            </div>
    );
}


export default App;
